INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawa', '', 'Our terms and conditions of delivery', 'conditions, delivery, delay, shipment, pack', '<h2>Przesyki i zwroty</h2>\n<h3>Przesyka Twojej paczki</h3>\n<p>Paczki s zazwyczaj wysyane w cigu 2 dni od otrzymania patnoci i wysyane za porednictwem firmy UPS z opcj ledzenia i nadania bez podpisu. Jeli wolisz dostaw UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opata, dlatego przed wybraniem tej metody skontaktuj si z nami. Bez wzgldu na to, jak wysyk wybierzesz, udostpnimy Ci link do ledzenia przesyki online.</p>\n<p>Opaty za wysyk obejmuj opaty manipulacyjne i pakowania, a take koszty wysyki. Opaty manipulacyjne s stae, natomiast opaty transportowe rni si w zalenoci od cakowitej wagi przesyki. Radzimy grupowa przedmioty w jednym zamwieniu. Nie moemy grupowa dwch odrbnych zamwie zoonych oddzielnie, a opaty za wysyk bd miay zastosowanie do kadego z nich. Twoja przesyka zostanie wysana na wasne ryzyko, ale dokadamy szczeglnej starannoci, aby chroni delikatne przedmioty.</p>\n<p></p>\n<p>Pudeka s odpowiednio due, a Twoje przedmioty s dobrze chronione.</p>', 'dostawa'),
(2, 1, 1, 'Nota prawna', '', 'Nota prawna', 'notice, legal, credits', '<h2>Nota Prawna *</h2>\n<h3>Informacje dotyczce strony internetowej</h3>\n<p>Wszystkie materiay i opublikowane na tej stronie informacje (w szczeglnoci teksty, zdjcia, utwory audiowizualne) stanowi przedmiot prawa autorskiego i przysuguj wskazanemu wyej podmiotowi (dalej: Sprzedawca) lub wykorzystywane s przez Sprzedawc za zgod ich wacicieli. Powielanie, rozpowszechnianie lub publiczne odtwarzanie moliwe jest wycznie za zgod Sprzedawcy. Wyraona zgoda nie moe zosta przeniesiona na inne podmioty oraz moe by w kadym czasie odwoana.*</p>\n<p></p>\n<p>Sprzedawca nie odpowiada za treci udostpniane na innych stronach internetowych, do ktrych linki znajduj si na stronie Sprzedawcy. W momencie umieszczania linkw zewntrznych na naszej stronie nie zauwaylimy pod docelowym adresem treci naruszajcych prawo. Jednake nie ponosimy odpowiedzialnoci za istnienie takich treci na innych stronach internetowych, poniewa strony te nie stanowi prezentacji naszych treci, oraz nie przejmujemy na siebie obowizku ich sprawdzania i nadzoru nad nimi.*<br /><br /><br /><br /><br /><br />* - nota utworzona na potrzeby projektu BE, nie majca nic wsplnego ze stanem faktycznym</p>', '-nota-prawna'),
(3, 1, 1, 'Regulamin uytkowania', '', 'Regulamin uytkowania', 'conditions, terms, use, sell', '<h2>Zasady uytkowania</h2>\n<h3>Zasada 1</h3>\n<p>Zakup nie moe by dokonany w celu dalszej dystrybucji.</p>\n<h3>Zasada 2</h3>\n<p>Dane uytkownikw podlegaj RODO.</p>\n<h3>Zasada 3</h3>\n<p>Nie akceptujemy patnoci w krypto walutach.</p>', '-regulamin-uzytkowania'),
(4, 1, 1, 'O nas', '', 'O nas', 'about us, informations', '<h2>O nas</h2>\n<h3>Nasza firma</h3>\n<p>Nasza firma powstaa w 2021 w Gdasku. Zgodnie z Fobsem jestemy jedn z najszybciej rozwijajcych si sklepw z lampami w Europie.</p>\n<h3>Nasz team</h3>\n<p>Mateusz, Jeremiasz, Micha, Piotrek</p>\n<h3>Informacje</h3>\n<p>Liczymy, e nasze produkty si Wam spodobaj!</p>', 'o-nas'),
(5, 1, 1, 'Bezpieczne patnoci', '', 'Bezpieczne patnoci', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Bezpieczne patnoci</h2>\n<h3>Nasze bezpieczne patnoci</h3>\n<p>Tylko u nas masz moliwo realizowania patnoci za pomoc SSL!</p>\n<h3>Pa Visa/Mastercard/Paypal</h3>\n<p>Dopuszczamy rone formy patnoci.</p>', 'bezpieczne-platnosci');
